import Layout from '../../components/Layout';

export default () => {
	return (
		<Layout>
			<br />
			<br />
			<p className="title has-text-link has-text-centered has-text-weight-normal">Schedule a meetings</p>
            <div className="columns">
                <div className="column is-3">s</div>
                <div className="column is-3">s</div>
                <div className="column is-3">s</div>
            </div>
		</Layout>
	);
};
